import React, { Component } from "react";
import CardList from "./CardList";
import { bs } from "./Bs";
import SearchBox from "./SearchBox";

class App extends Component {
  constructor() {
    super();
    this.state = {
      bs: bs,
      searchfield: ""
    };
  }

  onSearchChange() {}
  render() {
    return (
      <div className="tc">
        <h1>Blebz</h1>
        <SearchBox />
        <CardList bs={this.state.bs} />
      </div>
    );
  }
}

export default App;
